import React, { useState, useEffect } from 'react';
import { 
  BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend, 
  PieChart, Pie, Cell, 
  LineChart, Line,
  ComposedChart,
  ResponsiveContainer,
  ReferenceLine
} from 'recharts';
import axios from 'axios';

function ExploratoryDataAnalysisPage() {
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [mlData, setMlData] = useState(null);
  const [classificationReport, setClassificationReport] = useState(null);

  useEffect(() => {
    const fetchMLData = async () => {
      try {
        const response = await axios.get('http://127.0.0.1:5000/api/ml');
        setMlData(response.data);
        
        // Transform classification report for visualization
        const reportData = response.data.report;
        const formattedReport = [
          { 
            metric: 'Precision', 
            approved: reportData['1']['precision'] * 100, 
            declined: reportData['0']['precision'] * 100 
          },
          { 
            metric: 'Recall', 
            approved: reportData['1']['recall'] * 100, 
            declined: reportData['0']['recall'] * 100 
          },
          { 
            metric: 'F1-Score', 
            approved: reportData['1']['f1-score'] * 100, 
            declined: reportData['0']['f1-score'] * 100 
          }
        ];

        setClassificationReport(formattedReport);
        setLoading(false);
      } catch (err) {
        setError(err);
        setLoading(false);
      }
    };

    fetchMLData();
  }, []);

  if (loading) {
    return (
      <div className="page-container">
        <h1>Exploratory Data Analysis</h1>
        <div className="loading-indicator">Loading data analysis...</div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="page-container">
        <h1>Exploratory Data Analysis</h1>
        <div className="error-message">Error loading data: {error.message}</div>
      </div>
    );
  }

  return (
    <div className="page-container">
      <h1>Exploratory Data Analysis</h1>
      
      <div className="eda-container grid grid-cols-1 md:grid-cols-2 gap-6">
        {/* Model Performance Visualization */}
        <div className="bg-white shadow-lg rounded-lg p-6">
          <h2 className="text-xl font-semibold mb-4">Model Performance Metrics</h2>
          <ResponsiveContainer width="100%" height={300}>
            <ComposedChart data={classificationReport}>
              <XAxis dataKey="metric" />
              <YAxis domain={[0, 100]} />
              <Tooltip />
              <Legend />
              <Bar dataKey="approved" fill="#4CAF50" name="Approved Loans" />
              <Bar dataKey="declined" fill="#F44336" name="Declined Loans" />
              <Line type="monotone" dataKey="approved" stroke="#8884d8" />
            </ComposedChart>
          </ResponsiveContainer>
        </div>

        {/* Confusion Matrix Visualization */}
        <div className="bg-white shadow-lg rounded-lg p-6">
          <h2 className="text-xl font-semibold mb-4">Confusion Matrix</h2>
          <img 
            src={mlData.conf_matrix_url} 
            alt="Confusion Matrix" 
            className="w-full h-auto object-contain"
          />
        </div>

        {/* Feature Importance Visualization */}
        <div className="bg-white shadow-lg rounded-lg p-6 col-span-full">
          <h2 className="text-xl font-semibold mb-4">Feature Importance</h2>
          <img 
            src={mlData.feature_importance_url} 
            alt="Feature Importance" 
            className="w-full h-auto object-contain"
          />
        </div>

        {/* Classification Report Details */}
        <div className="bg-white shadow-lg rounded-lg p-6">
          <h2 className="text-xl font-semibold mb-4">Classification Report</h2>
          <table className="w-full">
            <thead>
              <tr className="bg-gray-100">
                <th className="p-2 text-left">Class</th>
                <th className="p-2 text-right">Precision</th>
                <th className="p-2 text-right">Recall</th>
                <th className="p-2 text-right">F1-Score</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td className="p-2 font-medium">Approved Loans</td>
                <td className="p-2 text-right">{(mlData.report['1']['precision'] * 100).toFixed(2)}%</td>
                <td className="p-2 text-right">{(mlData.report['1']['recall'] * 100).toFixed(2)}%</td>
                <td className="p-2 text-right">{(mlData.report['1']['f1-score'] * 100).toFixed(2)}%</td>
              </tr>
              <tr>
                <td className="p-2 font-medium">Declined Loans</td>
                <td className="p-2 text-right">{(mlData.report['0']['precision'] * 100).toFixed(2)}%</td>
                <td className="p-2 text-right">{(mlData.report['0']['recall'] * 100).toFixed(2)}%</td>
                <td className="p-2 text-right">{(mlData.report['0']['f1-score'] * 100).toFixed(2)}%</td>
              </tr>
            </tbody>
          </table>
        </div>

        {/* Overall Model Performance */}
        <div className="bg-white shadow-lg rounded-lg p-6">
          <h2 className="text-xl font-semibold mb-4">Model Performance Summary</h2>
          <div className="grid grid-cols-2 gap-4">
            <div>
              <p className="font-medium">Accuracy</p>
              <p className="text-2xl font-bold text-green-600">
                {(mlData.report['accuracy'] * 100).toFixed(2)}%
              </p>
            </div>
            <div>
              <p className="font-medium">Macro Avg F1-Score</p>
              <p className="text-2xl font-bold text-blue-600">
                {(mlData.report['macro avg']['f1-score'] * 100).toFixed(2)}%
              </p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default ExploratoryDataAnalysisPage;
